import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Button from "@mui/material/Button";

const Resume = () => {
  const handleDownload = () => {
    // Logic for downloading the resume image
    // You can replace the placeholder URL with the actual URL of your resume image
    const resumeImageUrl = "https://example.com/path/to/resume.png";
    const link = document.createElement("a");
    link.href = resumeImageUrl;
    link.download = "resume.png";
    link.click();
  };

  return (
    <Card>
      <CardContent>
        {/* Replace the src attribute with the actual URL of your resume image */}
        <img
          src="./resume.png"
          alt="Resume"
          style={{ width: "500%", height: "auto" }}
        />
        <Button variant="contained" onClick={handleDownload}>
          Download Resume
        </Button>
      </CardContent>
    </Card>
  );
};

export default Resume;
